import React from 'react';
import './navbar.css';

const NavBar = () => {
  return (
    <header className="header">
      <nav className="navbar">
        <img className='logo-img-home' src="/assets/img/logo.png" alt="" height={50} />
        <ul className="nav-links">
          <button>Login</button>
        </ul>
      </nav>
    </header>
  );
}

export default NavBar;
